import React from "react";
import forbidden from "./img/forbidden.png";

const Forbidden = (height, width) => {
  const classes = useStyles();
  return (
    <img
      src={forbidden}
      alt="forbidden"
      style={{ height: height, width: width }}
    />
  );
};

export default Forbidden;
